import React from "react";
import "./style.css";


function Nav() {
  return (
    <nav className="navbar navbar-expand-lg navbar-dark bg-primary">
      <a className="navbar-brand" href="/">
Google Books      </a>
      <a className="navbar-brand" href="/">
      Search
      </a>
      <a className="navbar-brand" href="/api/books">
      Saved
      </a>

    </nav>
  );
}

export default Nav;
